        self.StimInt_value.setText(QCoreApplication.translate("Spikeling", u"15", None))
        self.NeuronGenerator_subframe1_bottom_label.setText(QCoreApplication.translate("Spikeling", u"<html><head/><body><p>As most real neurons, the model does not have a fixed threshold: Depending on the history of the membrane potential prior to the spike, the threshold potential can be as low as -55 mV or as high as -40mV</p></body></html>", None))
        self.NeuronGenerator_Izhik_image.setText("")
        self.a_value.setText(QCoreApplication.translate("Spikeling", u"0.02", None))
        self.a_text.setText(QCoreApplication.translate("Spikeling", u"<html><head/><body><p><span style=\" font-size:9pt;\">The parameter </span><span style=\" font-size:12pt; font-weight:600;\">a</span><span style=\" font-size:9pt;\"> describes the time scale of the recovery variable </span><span style=\" font-size:9pt; font-weight:600;\">u</span><span style=\" font-size:9pt;\">. Smaller values result in slower recovery. </span></p><p><span style=\" font-size:9pt; text-decoration: underline;\">A typical value is </span><span style=\" font-size:9pt; font-weight:600; text-decoration: underline;\">a</span><span style=\" font-size:9pt; text-decoration: underline;\"> = 0.02.</span></p></body></html>", None))
        self.b_value.setText(QCoreApplication.translate("Spikeling", u"0.2", None))
        self.b_text.setText(QCoreApplication.translate("Spikeling", u"<html><head/><body><p>The parameter <span style=\" font-size:12pt; font-weight:600;\">b</span> describes the sensitivity of the recovery variable <span style=\" font-weight:600;\">u </span>to the subthreshold fluctuations of the membrane potential v. Greater values couple<span style=\" font-weight:600;\"> v</span> and<span style=\" font-weight:600;\"> u</span> more strongly resulting in possible sub-threshold oscillations and low-threshold spiking dynamics. </p><p><span style=\" text-decoration: underline;\">A typical value is </span><span style=\" font-weight:600; text-decoration: underline;\">b </span><span style=\" text-decoration: underline;\">= 0.2</span>. </p><p>The case <span style=\" font-weight:600;\">b</span> &lt; <span style=\" font-weight:600;\">a</span>(<span style=\" font-weight:600;\">b</span> &gt; <span style=\" font-weight:600;\">a</span>) corresponds to saddle-node (Andronov\u2013Hopf) bifurcation of the resting state.</p></body></html>", None))
        self.c_value.setText(QCoreApplication.translate("Spikeling", u"-65", None))
        self.c_text.setText(QCoreApplication.translate("Spikeling", u"<html><head/><body><p><span style=\" font-size:9pt;\">The parameter</span><span style=\" font-size:12pt; font-weight:600;\"> c</span><span style=\" font-size:9pt;\"> describes the after-spike reset value of the membrane potential v caused by the fast high-threshold K+ conductances. </span></p><p><span style=\" font-size:9pt; text-decoration: underline;\">A typical value is </span><span style=\" font-size:9pt; font-weight:600; text-decoration: underline;\">c</span><span style=\" font-size:9pt; text-decoration: underline;\"> = -65 (mV)</span><span style=\" font-size:9pt;\">.</span></p></body></html>", None))
        self.d_value.setText(QCoreApplication.translate("Spikeling", u"2", None))
        self.d_text.setText(QCoreApplication.translate("Spikeling", u"<html><head/><body><p><span style=\" font-size:9pt;\">The parameter </span><span style=\" font-size:12pt; font-weight:600;\">d</span><span style=\" font-size:9pt;\"> describes after-spike reset of the recovery variable </span><span style=\" font-size:9pt; font-weight:600;\">u</span><span style=\" font-size:9pt;\"> caused by slow high-threshold Na+ and K+ conductances.</span></p><p><span style=\" font-size:9pt; text-decoration: underline;\">A typical value is </span><span style=\" font-size:9pt; font-weight:600; text-decoration: underline;\">d</span><span style=\" font-size:9pt; text-decoration: underline;\"> = 2</span><span style=\" font-size:9pt;\">.</span></p></body></html>", None))
